    /**
     * Defines a numeric input field.
     */
    InputType["Number"] = "Number";
    /**
     * Defines a password field.
     */
    InputType["Password"] = "Password";
    /**
     * Used for input fields that should contain a telephone number.
     */
    InputType["Tel"] = "Tel";
    /**
     * Defines a one-line text input field:
     */
